const Header = (props) => {
  return (
    <Router>
      <nav id="main-menu">
        <ul>
          <li>
            <a href="home.js">Home</a>
          </li>
          <li>
            <a href="about.js">About</a>
          </li>
          <li>
            <a href="shop.js">Shop</a>
          </li>
          <li>
            <a href="help.js">Help</a>
          </li>
          {/* <li><HeaderCartButton/></li> */}
        </ul>
      </nav>
    </Router> 
  );
};

export default Header;
